import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit,
}) => {
  return (
    <form onSubmit={handleSubmit}>
      <label htmlFor="name">
        <input />
      </label>
      <br />
      <label>
        <input />
      </label>
      <br />
      <label>
        <input />
      </label>
      <br />
      <input />
    </form>
  );
};
